import photoPro from "../../images/photoPro.jpg";

function Informations() {
	return (
		<div className='informations-container'>
			<div className='image-container'>
				<img
					src={photoPro}
					width='302px'
					height='403px'
					style={{ borderRadius: "50%", boxShadow: "0 0 15px black" }}
					alt=''
				/>
			</div>
			<div className='text-container'>
				<p className="rose bold">Jérémy Lemoine Zemmour</p>
				<p className="green">Deuxième année de formation d'ingénieur généraliste</p>
                <br />
				<p className="orange">Adresse mail : <span className="bold">jeremy.lemoinezemmour@gmail.com</span></p>
			</div>
		</div>
	);
}

export default Informations;
